import React from 'react';
import web from '../src/image/constitution.svg';
import Common from './Common'





const Magzine = () => {
    return (
        <>
           <Common hname='WELCOME to Magazine' bname='Download!' image={web} pname='Association of Civil Engineering <br/> B.I.T SINDRI <br/> ESTD. 2017' />
           

        </>
    )
}

export default Magzine;
